package loopsLabExercises;

/**
 * for loops
 */
public class Part3Q6 {

	/**
	 * output odd numbers 10 - 40 inclusive
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		for (int i = 10; i <= 40; i++) {
			if (i % 2 != 0) {
				System.out.println(i);
			}
		}
	}

}
